('node', 'news', 0, 3, 3, 'und', 0, '<p><br /><strong>Recent Articles</strong><br /><br />&nbsp;&nbsp;&nbsp; Puzzles and Hearthstones: Thinking Outside the Box 1 day ago<br />&nbsp;&nbsp;&nbsp; Helpful Hearthstone Deck Building Hints 2 days ago<br />&nbsp;&nbsp;&nbsp; Hearthstone Innkeeper&#39;s Invitiational: Player Spotlight 4 days ago<br />&nbsp;&nbsp;&nbsp; (Updated) BlizzCon&reg; Store Online Sale Open Now Through November 9 18/10/2013<br />&nbsp;&nbsp;&nbsp; Hearthstone Closed Beta Patch Notes &ndash; 1.0.0.3937 18/10/2013<br />&nbsp;&nbsp;&nbsp; BlizzCon&reg; 2013 Map and Schedule 17/10/2013<br />&nbsp;&nbsp;&nbsp; Rexxar, the Hunter 14/10/2013<br />&nbsp;&nbsp;&nbsp; Hearthstone Innkeeper&#39;s Invitational 10/10/2013<br />&nbsp;&nbsp;&nbsp; BlizzCon Merchandise Sale Coming Oct. 11&mdash;Get a Sneak Peek Now! 09/10/2013<br />&nbsp;&nbsp;&nbsp; Hearthstone Closed Beta Patch Notes 02/10/2013<br />&nbsp;&nbsp;&nbsp; Closed Beta Patch &ndash; Featured Updates 30/09/2013<br /><br /><span style="font-size:14px;"><strong>Load more</strong></span><br />Hearthstone Innkeeper&#39;s Invitiational: Player Spotlight<br />Zeriyah 22/10/2013 57<br />Hearthstone Innkeeper&#39;s Invitiational: Player Spotlight<br /><br />As we get closer to BlizzCon and the Hearthstone Innkeeper&rsquo;s Invitational tournament, we took some time to talk with our Inn-vitees to get to know them a little better. In our Invitational announcement, we featured the eight players invited to participate in this fun tournament at BlizzCon: Noxious, Hafu, Husky, Reckful, Trump, Kripparian, Day[9], and Artosis. In today&rsquo;s blog post, we profile four of the eight players in the tournament, and we&rsquo;ll profile the last four in a future blog. If you&rsquo;re unsure of who to root for in the tournament, read on and see if some of their Arena picks line up with yours, what their favorite cards are, and who they dread going up against live at BlizzCon!<br /><br />Noxious<br /><br /><br /><br />What got you into playing Hearthstone?<br /><br />I&#39;ve been a Magic: the Gathering addict since my very early age, and World of Warcraft was the first MMO which I played on a &quot;hardcore&quot; level. I never had the funds (nor the nearby community) to get into the old WoW TCG, and was absolutely ecstatic when Hearthstone was announced. It was the best of all worlds: it was on a computer, it was a card game, and it was in the Warcraft Universe. I had a nerd epiphany.<br /><br />What&rsquo;s your Battlecry?<br /><br />&quot;That&#39;s the play!&quot; When we win: &quot;Jay Jay!&quot;<br /><br />What are your top 5 must-have Arena picks?<br /><br />I typically try to aim for cards that will be useful regardless of whether or not they make it to the next turn, so if I were to cite &quot;must-haves&quot; in common cards, I&#39;d probably say the Dark Iron Dwarf, Cult Master and Harvest Golem. The first can give you an instantaneous &quot;positive trade&quot; (trading a small minion for a larger, more costly one), the second one can be played before you&#39;re about to trade everything you&#39;ve got to replace it all, and the third one is a complete nightmare to deal with.<br /><br />There are a lot of Rare cards I value highly, but I think the Azure Drake and Argent Commander are my top 2 favorite to see. The Drake being a 4/4 makes it a good,solid body, but the Spell Power and cantrip effect smacked onto it are just lovely. As for the Argent Commander, he&#39;s a surprise on a stick that can change board states on his own. This is even truer when you are not forced to use his Divine Shield right away (e.g: kill a Flametongue Totem), as the opponent will at least trade one card for it, and in some cases 2 or 3, and that is AFTER you&#39;ve used him once!<br /><br />If you had a card designed after you, what would it do?<br /><br />I think it would be a Legendary Gnome alchemist character that kills other minions at random by throwing vials of poison on them at the start or end of your turn. :D<br /><br />What other players in the Hearthstone community do you fear or respect? Anyone you dread being matched up against?<br /><br />Even though some of the people who have watched me think I&#39;m a really good player, I know full well that a lot of the players in the ManaGrind community straight up outclass me, although they are much less known. Of those that I consider the best players, spaJJ comes to mind as well as Moon, Byke and jotto. And Doroxx, but I haven&#39;t seen him around in a long time! Can&#39;t say I&#39;m eager to go against Trump and Kripparrian either. . . .</p>', 'As we get closer to BlizzCon and the Hearthstone Innkeeper’s Invitational tournament, we took some time to talk with our Inn-vitees to get to know them a little better. In our Invitational announcement, we featured the eight players invited to participate in this fun tournament at BlizzCon: Noxious, Hafu, Husky, Reckful, Trump, Kripparian, Day[9], and Artosis. In today’s blog post, we profile four of the eight players in the tournament, and we’ll profile the last four in a future blog. If you’re unsure of who to root for in the tournament, read on and see if some of their Arena picks line up with yours, what their favorite cards are, and who they dread going up against live at BlizzCon!', 'plain_text');
